import React from 'react';
import MyPosts from './MyPosts/MyPosts';
import { ProfileInfo } from './ProfileInfo/ProfileInfo';

const Profile = (state) => {
  return (
    <div>
      <ProfileInfo/>
      <MyPosts posts={state.posts} addPost={state.addPost}/>
    </div>
  )
}

export default Profile;
